    /** Contains a CryptoImplementation and a set of keys */
    public static class TestIdentity {
        public String base64PublicKeyPair;
        public String base64PrivateKeyPair;
        public CryptoImplementation cryptoImpl;
        public PublicKeyPair publicKeys;
        public PrivateKeyPair privateKeys;
        public KeyPair encryptionKeys;
        public KeyPair signingKeys;
        public EmailIdentity identity;
        
        private TestIdentity(String base64PublicKeyPair, String base64PrivateKeyPair, CryptoImplementation cryptoImpl) throws GeneralSecurityException {
            this.base64PublicKeyPair = base64PublicKeyPair;
            this.base64PrivateKeyPair = base64PrivateKeyPair;
            this.cryptoImpl = cryptoImpl;
            
            publicKeys = cryptoImpl.createPublicKeyPair(base64PublicKeyPair);
            privateKeys = cryptoImpl.createPrivateKeyPair(base64PrivateKeyPair);
            signingKeys = new KeyPair(publicKeys.signingKey, privateKeys.signingKey);
            encryptionKeys = new KeyPair(publicKeys.encryptionKey, privateKeys.encryptionKey);
            
            identity = new EmailIdentity(base64PublicKeyPair + base64PrivateKeyPair);
        }
    }
